import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { id: "e1", title: "Max's Birthday Bash", },
  { id: "e2", title: "React Conference 2025" },
  { id: "e3", title: "Dinner with Friends" },
];

function EventsPage() {
  return (
    <ul>{DUMMY_EVENTS.map(event => <li key={event.id}><Link to={`/events/${event.id}`}>{event.title}</Link></li>)}</ul>
  )
}

export default EventsPage;
